### 获取游戏列表

#### 1) 请求地址
&gt; URL: {APIURL}/api/v1/game/list

#### 2) 请求参数

| 参数名 | 类型 | 描述 |
| --- | --- | --- |
| Language | string | 语言设定 th, en ... |

- 示例：
```json
{
    &quot;Language&quot;: &quot;th&quot;
}
```

