### 游戏动态调控

#### 1) 请求地址
&gt; URL: {APIURL}/api/v1/game/monitor

#### 2) 请求参数
| 参数名 | 类型 | 描述 |
| --- | --- | --- |
| MoniterType | int | 监控类型，值为`0`时为`机台监控`值为`1`时为`个人监控`|
| IsMoniter | int | 监控的开启状态，值为`0`时为`关闭`值为`1`时为`开启`|
| MoniterNewbieNum | int | 新玩家游戏局数 |
| MoniterRTPErrorValue | int | 玩家RTP误差范围 |
| MoniterNumCycle | int | 游戏内统计数据周期 |
| MoniterAddRTPRangeValue | []object | 增加RTP范围，玩家RTP低于配置值时，有概率使玩家强制中奖。玩家RTP是指玩家在对应的机台的终生RTP。列表中的每一个object代表一个`挡位`，其中包含两个值`NewbieValue`,`NotNewbieValue`。&lt;br&gt; `NewbieValue`为`int`类型，表示新手玩家RTP进行游戏调控的触发概率。&lt;br&gt;`NotNewbieValue` 为`int`类型，表示非新手玩家RTP进行游戏调控的触发概率。|
| MoniterReduceRTPRangeValue | []object | 减少RTP范围，玩家RTP高于配置值时，有概率使玩家强制不中奖。玩家RTP是指玩家在对应的机台的终生RTP。列表中的每一个object代表一个`挡位`，其中包含两个值`NewbieValue`,`NotNewbieValue`。&lt;br&gt;`NewbieValue`为`int`类型，表示新手玩家RTP进行游戏调控的触发概率。&lt;br&gt;`NotNewbieValue` 为`int`类型，表示非新手玩家RTP进行游戏调控的触发概率。|

- 示例：
```json
{
    &quot;MoniterType&quot;: 0,
    &quot;IsMoniter&quot;: 1,
    &quot;MoniterNewbieNum&quot;: 50,
    &quot;MoniterRTPErrorValue&quot;: 5,
    &quot;MoniterNumCycle&quot;: 5,
    &quot;MoniterAddRTPRangeValue&quot;: [{
        &quot;NewbieValue&quot;: 0,
        &quot;NotNewbieValue&quot;: 0
    }, {
        &quot;NewbieValue&quot;: 4,
        &quot;NotNewbieValue&quot;: 4
    }, {
        &quot;NewbieValue&quot;: 8,
        &quot;NotNewbieValue&quot;: 8
    }, {
        &quot;NewbieValue&quot;: 12,
        &quot;NotNewbieValue&quot;: 12
    }],
    &quot;MoniterReduceRTPRangeValue&quot;: [{
        &quot;NewbieValue&quot;: 0,
        &quot;NotNewbieValue&quot;: 1
    }, {
        &quot;NewbieValue&quot;: 5,
        &quot;NotNewbieValue&quot;: 5
    }, {
        &quot;NewbieValue&quot;: 10,
        &quot;NotNewbieValue&quot;: 10
    }, {
        &quot;NewbieValue&quot;: 15,
        &quot;NotNewbieValue&quot;: 15
    }, {
        &quot;NewbieValue&quot;: 20,
        &quot;NotNewbieValue&quot;: 20
    }]
}
```

#### 3) 返回结果
code为0为正常返回
- 示例：
```json
{
    &quot;code&quot;: 0,
    &quot;error&quot;: &quot;&quot;,
    &quot;data&quot;: {}
}
```
